import React, { useState } from "react";

function Cart(props) {
  return (
    <div className="cart">
      <h2>Cart</h2>
      <ul>
        {props.cartItems.map((item) => (
          <li key={item.id}>{item.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default Cart;
